Title: Moby Dick (2011)
Country: South Korea
Language: Korean
Film Genre: Drama | Thriller
IMDB URL: http://www.imdb.com/title/tt1984208/
Director: Park In-Je
Cast: Hwang Jung-Min, Jin Goo, Kim Min-Hee


Plot or Synopsis
A mysterious explosion occurs at the Balam Bridge in Seoul on November 20th, 1994.

In front of hot-blooded local news reporter Lee Bang-Woo (Hwang Jung-Min), Yoon-Hyuk (Jin Goo) appears.
Yoon-Hyuk is from the same hometown as Lee Bang-Woo, but they haven't seen each other in a long time.
Yoon-Hyuk hands over documents to Lee Bang-Woo and hints that the case of the Balam Bridge was fabricated. In order to uncover the truth behind the case, Lee Bang-Woo teams up with fellow reporters Son Jin-Ki (Kim Sang-Ho) and Sung Hyo-Kwan (Kim Min-Hee).

